import Mock from 'mockjs'

const random = Mock.Random // Mock.Random 是一个工具类，用于生成各种随机数据

let banners={}

function get() {
  let img_data=['data:image/jpeg;base64,',
    'https://ss3.bdstatic.com/70cFv8Sh_Q1YnxGkpoWK1HF6hhy/it/u=4086078517,1263369966&fm=26&gp=0.jpg',
    'data:image/jpeg;base64,']
  let data=[]
  for (let i = 0; i < 3; i++) {
    let obj={
      title:random.cname(),
      img_url:img_data[i] // Random.size表示将从size数据中任选一个数据
    }
    data.push(obj)
  }
  return data
}

banners.get=get()
export default banners
